                          className="floatRight"
                        />
                      </Link>
                    </span>
                  </div>
                </div>
              </div>
            </>
          ) : (
            <>
              <h1>hell</h1>
            </>
          )}
        </div>
        <ToastContainer />
      </div>
    );
  }
}

export default App;
